  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"ios-cheat-sheet"}}>{`iOS Cheat Sheet`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"objios-1-open-settings"}}>{`OBJIOS-1: Open Settings`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-objective-c"}}>{`[[UIApplication sharedApplication] openURL:[NSURL URLWithString:UIApplicationOpenSettingsURLString]];
`}</MDXTag></MDXTag>
<MDXTag name="h1" components={components} props={{"id":"dates-and-time"}}>{`Dates and Time`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"check-if-the-time-is-between-two-hours"}}>{`Check if the time is between two hours`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-objective-c"}}>{`-(void)checkTimeFrame
{
  NSDateComponents *components = [[NSCalendar currentCalendar] components:NSHourCalendarUnit | NSMinuteCalendarUnit | NSSecondCalendarUnit fromDate:[NSDate date]];
  NSInteger currentHour = [components hour];

  if (currentHour < 9 && currentHour > 3) {
    // Do Something
    NSLog(@"In between the times");
    NSLog(@"%ld\n", (long)currentHour);
  } else {
    NSLog(@"Not between the times");
    NSLog(@"%ld\n", (long)currentHour);
  }
}
`}</MDXTag></MDXTag>
<MDXTag name="h1" components={components} props={{"id":"uisearchbar"}}>{`UISearchBar`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"target-search-bar-after-load"}}>{`Target Search Bar after load`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-objective-c"}}>{`-(void)viewDidAppear:(BOOL)animated
{
  [self.searchBar becomeFirstResponder];
}
`}</MDXTag></MDXTag>
           </MDXTag>
  }
}
